script: |
  super -f text -I q647.spq | sort > q647.out

inputs:
  - name: q647.spq
    data: |
      SELECT - - col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col0 IN ( col1 + - 42 + - 86 / col1 * - col2 + - col2 + - 63, 7 * - col1 );
  - name: tab0

outputs:
  - name: q647.out
    data: |
      15
      87
      97
